import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;
export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 677px;
    left: 0px;
    top: 0px;   
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 40px 40px 0px 0px;
`;
